"<p>This is the intro post for the front page of Blog A.</p>\n\n<p>Blog A is currently configured to show a front page like this one instead of directly showing the blog's posts.</p>\n\n<ul>\n\t<li>To view the blog's posts, click on \"News\" in the menu above.</li>\n\t<li>If you don't want to have such a front page, you can disable it in the Blog's settings > Features > <a %s>Front Page</a>. You can also see an example of a blog without a Front Page in Blog B</li>\n</ul>" => "<p>Dies ist der Intro-Eintrag für die Startseite von Blog A.</p>\n\n<p>Blog A ist momentan so konfiguriert, dass er eine Startseite wie diese anzeigt, anstatt direkt die Einträge des Blogs anzuzeigen.</p>\n\n<ul>\n⇥<li>Um die Einträge des Blogs zu sehen, klicken Sie oben in dem Menü auf \"Neuigkeiten\".</li>\n\n⇥<li>Wenn Sie so eine Startseite nicht haben möchten, können Sie sie in den Blog-Einstellungen > Features > <a %s>Startseite</a> ändern. In Blog B können Sie ein Beispiel dafür sehen, wie ein Blog ohne Startseite aussieht.</li>\n</ul>",
'Welcome to Blog A' => 'Willkommen zu Blog A',
"<p>This is the first post.</p>\n\n<p>It appears in a single category.</p>" => "<p>Das ist der erste Eintrag.</p>\n\n<p>Er erscheint in einer einzelnen Kategorie.</p>",
