"<p>This blog is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about %s.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Dieses Blogsystem wird mit b2evolution betrieben.</p>\n\n<p>Sie sehen sich gerade eine Infoseite über %s an.</p>\n\n<p>Infoseiten ähneln normalen Einträgen stark, erscheinen aber nicht in der normalen Eintragsabfolge. Sie erscheinen stattdessen als Infoseiten in der Seitenleiste.</p>\n\n<p>Falls benötigt, können Infoseiten unter Verwendung eines Evoskins anders als reguläre Einträge formatiert werden.</p>",
'About Blog B' => 'Über Blog B',
'Blog B' => 'Blog B',
'About Blog A' => 'Über Blog A',
'Blog A' => 'Blog A',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this site.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "</p>Diese Blog-Plattform wird mit b2evolution betrieben.</p>\n\n</p>Sie sehen gerade eine Info-Seite für diese Seite.</p>\n\nInfoseiten sind normalen Einträgen sehr ähnlich, mit dem Unterschied, dass sie nicht zwischen normalen Einträgen angezeigt wird. Stattdessen tauchen sie als Info-Seiten in der Seitenleiste auf.</p>\n\n</p>Falls benötigt, können Infoseiten unter Verwendung eines Evoskins anders als reguläre Einträge formatiert werden.</p>",
